const SquareShape = ({ fill, backgroundColor, ...props }: Props) => {
  function roundedRectPath(
    x: number,
    y: number,
    width: number,
    height: number,
    radii: [number, number, number, number] // [tl, tr, br, bl]
  ): string {
    const [tl, tr, br, bl] = radii;

    return `
    M${x + tl} ${y}
    H${x + width - tr}
    a${tr} ${tr} 0 0 1 ${tr} ${tr}
    V${y + height - br}
    a${br} ${br} 0 0 1 -${br} ${br}
    H${x + bl}
    a${bl} ${bl} 0 0 1 -${bl} -${bl}
    V${y + tl}
    a${tl} ${tl} 0 0 1 ${tl} -${tl}
    Z
  `;
  }

  return (
    <svg
      width="215"
      height="215"
      viewBox="0 0 215 215"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      {...props}
    >
      <rect width="215" height="215" rx="12" fill="#F4650D" />
      <path
        d={roundedRectPath(0, 125, 215, 90, [0, 0, 12, 12])}
        fill="#07417F"
      />
    </svg>
  );
};

