export const CircleDotShape = ({
  fill = "#000000",
  backgroundColor = "#FFFFFF",
  ...props
}: Props) => {
  const size = 220;
  const center = size / 2;
  const outerRadius = 108;
  const innerSafeRadius = 65; // center area left clean for QR
  const dotRadius = 1.5;
  const dotCount = 200;

  const dots: JSX.Element[] = [];

  for (let i = 0; i < dotCount; i++) {
    const angle = Math.random() * 2 * Math.PI;
    const distance =
      innerSafeRadius + Math.random() * (outerRadius - innerSafeRadius - 4);
    const x = center + Math.cos(angle) * distance;
    const y = center + Math.sin(angle) * distance;
    dots.push(<circle key={i} cx={x} cy={y} r={dotRadius} fill={fill} />);
  }

  return (
    <svg
      width={size}
      height={size}
      viewBox={`0 0 ${size} ${size}`}
      xmlns="http://www.w3.org/2000/svg"
      {...props}
    >
      {/* Background circle */}
      <circle
        cx={center}
        cy={center}
        r={outerRadius}
        fill={backgroundColor}
        stroke={fill}
        strokeWidth={4}
      />

      {/* Random background dots */}
      {dots}
    </svg>
  );
};

export const backgrounds: Record<
  BackgroundType,
  BackgroundFunctionArgumentType
> = {
  circleCut: (fill) => {
    return <CircleCutShape fill={fill} />;
  },

  circleLineShape: (fill, backgroundColor) => {
    return <CircleLineShape fill={fill} backgroundColor={backgroundColor} />;
  },

  circleSmoothLineShape: (fill, backgroundColor) => {
    return (
      <CircleSmoothLineShape fill={fill} backgroundColor={backgroundColor} />
    );
  },

  circleDotShape: (fill, backgroundColor) => (
    <CircleDotShape fill={fill} backgroundColor={backgroundColor} />
  ),

  squareShape: (fill, backgroundColor) => {
    return <SquareShape fill={fill} backgroundColor={backgroundColor} />;
  },

  borderCircle: (fill, backgroundColor, isAddFrame) => {
    if (isAddFrame) {
      return (
        <BoldBorderWithCircle fill={fill} backgroundColor={backgroundColor} />
      );
    } else {
      return (
        <LightBorderWithCircle fill={fill} backgroundColor={backgroundColor} />
      );
    }
  },

  borderSquare: (fill, backgroundColor, isAddFrame) => {
    if (isAddFrame) {
      return (
        <BoldBorderWithSquare fill={fill} backgroundColor={backgroundColor} />
      );
    } else {
      return (
        <LightBorderWithSquare fill={fill} backgroundColor={backgroundColor} />
      );
    }
  },

  none: (): any => {
    return <div />;
  },
};
